import "./App.css";
import React, { useEffect, useState } from "react";
import Movies from "./components/Movies"

function App() {
  const [movies, setMovies] = useState([]);

  useEffect(() => {
    fetch("/movies").then((response) =>
      response.json().then((data) => {
        setMovies(data);
      })
    );
  }, []);

  return (
    <div className="App">
      <Movies />
    </div>
  );
}

export default App;
